import Header from './Header';

function DisplayStudents() {
    return (
        <div className="DisplayStudents">
            <Header title="Display All Student Records  "/>
            <nav className="nav nav-dark navbg-dark">
                <a className="nav-item nav-link active" aria-current="page" href="/">Home</a>
                <a className="nav-item nav-link" href="/addstudent">Add Student Profile</a>
                <a className="nav-item nav-link" href="/displaystudents">Display Student Profiles</a>
            </nav>
            <div className="container">
                
            </div>
        </div>
    )
}

export default DisplayStudents;
